import { MantineProvider, Box, Card, TextInput, Button } from "@mantine/core";
import axios from "axios";
import styles from './Home.module.css'; // Importando o módulo CSS

function Home() {
  const usuario = {
    usuario: "ss",
    senha: "dd",
  };

  const autenticar = () => {
    axios.post(`http://localhost:8080/usuario/cadastro`, usuario); // Corrigi a concatenação da URL
  };

  return (
    <MantineProvider>
      <Box className="div">
        <Card shadow="md" withBorder padding="md">
          <TextInput
            onChange={(e) => (usuario.usuario = e.target.value)}
            value={usuario.usuario}
            classNames={{ input: styles.usuario }} // Usando a classe do módulo CSS
          />
          <TextInput
            onChange={(e) => (usuario.senha = e.target.value)}
            value={usuario.senha}
            classNames={{ input: styles.senha }} // Usando a classe do módulo CSS
          />
          <Button onClick={() => autenticar()}>dddd</Button>
        </Card>
      </Box>
    </MantineProvider>
  );
}

export default Home;
